import React, { useEffect } from "react";

export default function App() {
  let a = 1;

  useEffect(() => {
    console.log("test");
  }, [a]);

  setInterval(() => {
    console.log(a);
    a = a++;
  }, 1000);

  return <div>test</div>;
}
